                return {
                    meta: element.meta,
                    metaText: JSON.stringify(element.meta, null, 4).replace((/\n/g), '<br>\n'),
                    x: element.x + 0.25 + 0.05 * ii,
                    y: element.y
                };
            }),
        marker: {
            radius: 2
        },
        name: key.split('/')[2]
    });
});
